import React from 'react';

export default function Filters(props) {
    const {label, filters, sortBy} = props;

    return (
        <div>
            <h3>{label}</h3>
            <ul>
                {
                    filters.map(filter => (
                        <li>
                            <label>
                                <input type="checkbox" value="filter" />
                                {filter}
                            </label>
                        </li>
                    ))
                }
            </ul>
        </div>
    );
}
